(224, 20, 206, 'Håkin lenkki / Håkkis trodon', 'Reitti on pääosin helppokulkuinen, matkan varrella on jonkin verran korkeuseroja. Polku kiertelee vaihtelevassa maastossa polkuja ja metsäteitä pitkin. Reitillä ei ole rakennettuja taukopaikkoja.', 3, '107', 1),
(225, 20, 207, 'Saaristopolku / Skärgårdsleden', 'Reitti kulkee osittain vaativassa maastossa, matkan varrella on korkeuseroja ja kivikkoisia alueita. Kaikki taukopaikat soveltuvat päiväaikaisen retkeilyn kohteeksi.', 3, '108', 1),
(226, 20, 208, 'Knivsundin reitti / Knivsunds friluftsled', 'Polku kulkee helppokulkuisessa maastossa osittain metsäteitä pitkin. Polku on merkitty retkeilijäkyltein ja sille voi lähteä myös tienylityspaikoista. Kuusikkometsän katveessa olevan laavun vieressä on nuotiopaikka.', 3, '109', 1),
