(523, 49, 490, 'Suomen Sodan taistelupaikka', 'Rytilammen taistelun (25.9.1808) paikalle on asetettu muistotaulu vuonna 2008. Ruotsi-Suomen armeija voitti kahakan Venäjän joukkoja vastaan.', 1, '672', 1),
(524, 49, 491, 'Haapaniemenjärvi', 'Taukopaikka, jossa voi pysähtyä pohtimaan paikan historiaa. Lähistöllä on 1867-1868 nälkävuosina tehdyn kivisillan jäännökset, ensimmäisen Kaarlela - Kälviä pitäjänrajan rajakivi ja 1930-luvulla kuivatun Korpijärven järvikuivio.', 1, '673', 1),
(525, 49, 492, 'Klapurin vanha riihi', 'Klapurin vanha riihi, joka Isonvihan aikaan oli karjan piilopaikkana entisessä paikassaan, syrjäisellä Koivulaakson pellolla. Riihen seinässä näkyvät lehmien kiinni kytkemiseen tarkoitetut reiät.', 1, '674', 1),
(526, 49, 493, 'Suomen Sodan taistelupaikka', 'Peltokorven Portaanpäänmäen taistelun (27.5.1808) muistoksi on venäläisten asemien paikalle pystytetty tykki, jossa on muistolaatta.', 1, '675', 1),
(527, 49, 494, 'Suomen Sodan taistelupaikka', 'Peltokorven Korpraalinmäen taistelun (27.5.1808) muistoksi on asetettu muistokivi ruotsalaisten ja talonpoikien asemien paikalle, nykyiselle koulun piha-alueelle. Venäläiset voittivat kahakan ja etenivät Kälviän kirkonkylään.', 1, '676', 1),
(528, 49, 495, 'Kuokkamäen pelto', 'Kuokkamäen pelto, johon perimätiedon mukaan on vuonna 1808 haudattu 12 kaatunutta venäläistä.', 1, '677', 1),
