INSERT INTO `viesti` (`viesti_id`, `aihe`, `sisalto`, `lahettaja`, `aikaleima`, `kuitattu`) VALUES
(19, 1, 'Onko jääkentät auki?', '0445017674', '2017-12-18 16:21:25', '2017-12-19 08:15:22'),
(20, 2, 'Voisiko santahaan kentän aukaista?', '0445017674', '2017-12-19 15:29:35', '2017-12-20 09:56:06'),
(21, 1, '0 OR 1=1', '', '2017-12-21 10:57:34', '2017-12-21 11:00:07'),
(25, 3, 'Rytikankaan latu oli joulupäivänä hyvässä kunnossa mutta tämän sivuston mukaan suljettu? Päivityskysyms vai mikä?', '0405582270', '2017-12-26 10:18:26', NULL),
(26, 3, 'Onhan tämä aika alaluokkaista jään hoitoa kälviällä. Aamulla käydään hyvällä tuurin auraamassa kaukalo. Kaukalolla olevat kolat ja jäänpuhdistus työkalut ovat lukkojen takana toisessa pukukopissa. Tänään oli molemmat pukukopit auki saivat halukkaat itse aurata jään puhtaaksi mutta sen jälkeen jään hoitaja tuli itse laittaamaan pukukopin taas kiinni ja ei varmaan aukea enään tänä luistelu kautena. Vaikkei kukaan ei ole rikkonut kolia. Ja jään hoitajalla olisi kyllä päivässä aikaa hoitaa jäät ja ladut kuntoon mutta hän tykkää enemmän olla kahvilla kun hoitamassa töitään. Toivoisin pikaista vastausta miksi näin käyttäydytään ? T Niko Ahola', 'niko.ahola17@hotmail.fi', '2017-12-27 20:02:46', NULL),
(27, 3, 'Hei. Uudesta liikuntapaikka-sivustosta tarvis mobiiliversion myös. Ja valikon fontti on turhan iso läppärilläkin.', 'ville.lauri@gmail.com', '2017-12-28 11:15:42', '2017-12-28 12:05:27'),
(28, 1, 'Hei,\n\nOnko Houraati - Karhi välisellä latupohjalla jotain erikoista kun sinne ei ole latua avattu?\n\nT:Vesa', 'tuorve@hotmail.fi', '2018-01-08 09:19:14', '2018-01-10 08:58:36'),
(29, 3, 'Hei! Kävin viime viikolla hiihtämässä Köykärillä arki-iltana. Ihmettelin miksi osa hiihtäjistä käytti otsalamppuja. Se selvisi kun itse pääsin ladulle. Ladun varresta oli palanut 5-6 lamppua. Yhdestä kohtaa 5km:n lenkkiä lamput ovat olleet palaneet, oman muistikuvan mukaan, viimeiset kaksi vuotta. Olisiko mahdollista, että palaneiden lamppujen tilalle vaihdettaisiin uudet? Tilanne aiheuttaa jo vaaratilanteita ladulla, kun yhtäkkiä ladulla on laskussa pimeä kohta. Säästää pitää, mutta voisiko säästää jostain muualta;) \n\nHeidi', 'heidi.kottari@gmail.com', '2018-01-08 19:14:52', '2018-01-10 08:58:30'),
(30, 3, 'Köykari Perhonjoki latu on kunnossa.\n', '050 338 7477', '2018-01-09 07:22:28', '2018-01-10 08:58:15'),
(31, 3, 'Köykar Perhonjoki 3,4 km ladun voi muuttaa niin että siinä lukee Köykar Isokoski 6 km. GIF talkooryhmä pitää ladun kunnossa. Ajamme ladun aina heti kun tulee uutta lunta. Tällä viikolla vedämme ladun Haapkoskelle. Terveisin Erik Wikström, puh. 0503387447.', 'erik.wikstrom@pp.kpnet.fi', '2018-01-09 08:29:27', '2018-01-10 08:58:22'),
(32, 2, 'Voisiko Houraati - Karhi - Marinkainen ladun ajaa useammin. Nytkin on satanut uutta lunta ja olisi mahtava keli mutta latua ei ole vielä ajettu, eikä vitsisi lähteä autolla Houraatiin jyrkkiä mäkiä hiihtämään', '', '2018-02-02 14:37:57', '2018-02-02 14:47:02'),
(33, 3, 'Köykari- Isokoski-k\nIsokoski-Haapkoski-k\n', 'erik.wikstrom@pp.kpnet.fi', '2018-02-11 13:00:06', '2018-02-12 10:09:55'),
(34, 1, 'Onko Kokkolan alueella mitään sellaista latua missä saisi ottaa koiran mukaan? Pieni koira joka on valjaissa vyössä kiinni?', 'terhi.seppa@elisa.fi', '2018-02-11 15:12:36', '2018-02-12 14:58:31'),
(35, 3, 'Ridankylään menevä latu puuttuu hiihtolatu tiedoista . Latu on ollut 30 vuotta käytössä ,parina edellisenä talvena lumenpuutten vuoksi pois käytöstä . Terveisin latua hoitanut ja kellkalla aurannut talkoolainen Taisto Hankaniemi puh. 0445561841', '0445561841', '2018-02-12 10:06:32', '2018-02-12 14:52:07'),
(36, 2, 'Hei!\n\nVoisiko kaikkien (jää)latujen ja -teiden yhteyteen lisätietokohtaan selventää, onko kyseessä perinteisen vai luisteluhiihdon latu, tai molemmat? Myös, onko retkiluistelu mahdollista? Nyt nämä tiedot puuttuvat monelta reitiltä. Kiitos!\n\n-Timo Kaivosoja', 'tkaivosoja@hotmail.com', '2018-02-18 13:34:35', '2018-03-05 12:06:06'),
(37, 1, 'Varför tror man att alla motionsåkare skidar klassiskt? Åtminstone till Rastimaja finns det tillräckligt utrymme för fristil om spårdragningen justeras! Nu är alla fristilsåkare hänvisade till Sandhagen, det överlägset tråkigaste spåret  staden.', 'mans.akerblom@anvianet.fi', '2018-02-27 14:35:59', '2018-03-05 12:09:18'),
(39, 3, 'Minkä takia kaupungin lahdelle ei ole tehty latuja , vaikka on hiihtolomaviikko, sää aurinkoinen, lunta tarpeeksi,eikä lumipyryä ole tiedossa,  pakkanenhan on vain pukeutumiskysymys. Latukartassa näkyy Mustakari -Rastimaja reitti vihreällä, mutta latua ei ole aurattu. Kiitos kuitenkin Harbåda-Elba hienosta ladusta.\nAurattuja latuja kaupungin lahdelle ristiin rastiin toivoen\nSanna-Liisa Kalajo\n\n', '', '2018-02-28 20:43:42', '2018-03-05 12:09:25'),
(40, 1, 'Hei, saiskohan pikkuhiljaa sokojan koululle jään? Mahtavat kelit ollu jo pitkään, eikä ole edes alotettu jäädytystä. ', 'raisa.gromov@gmail.com', '2023-12-06 22:11:59', NULL),
(41, 1, 'Hei! Miksi hiihtolatu listalta on kadonnut koivuhaan reitti joka menee ympäri koivuhaan (luistinradan, raviradan, isojärven läheltä ja hautausmaan läheltä)? \n', 'lampela.roosa@gmail.com', '2023-12-12 16:58:30', NULL),
(42, 1, 'Hei\n\nAjetaanko tänä talvena latua sannanrannan tien alkupään parkkikselta elbaan päin? ', 'heidimaria.soderholm@gmail.com', '2024-01-14 15:36:30', NULL),
(43, 2, 'Rytikankaan hiihtoladulla muutama lamppu pimeänä.\nOlisiko mahdollista saada lisää valoa kansalle?', '', '2024-01-24 23:15:07', NULL),
(44, 2, 'Saisiko koivuhaan ympäri menevän ladun taas käyttöön? Se on edellisinä vuosina ollut ja ollut tosi hyvä ja käytetty. ????????', 'lampela.roosa@gmail.com', '2024-02-15 15:36:54', NULL),
(45, 1, 'Ensilumenlatu poikki vak ei? ', 'alf.bjorkstrand@gmail.com ', '2024-12-09 10:05:38', NULL),
(46, 3, 'Latu on vedetty Köykari-Isokoski-Haapkoski. ', '050 3387447', '2024-12-21 18:17:41', NULL);
